import mapboxgl from 'mapbox-gl'
import BaseLayerSwitch from '../Map/baselayerswitch.js'

let map
const MapWithClusters = {
  init: (data) => {
    mapboxgl.accessToken = process.env.MAPBOX_ACCESS_TOKEN
    map = new mapboxgl.Map({
      container: 'buildingListMap',
      style: process.env.MAPBOX_STYLE,
      center: [4.4006, 50.8452],
      zoom: 10.24
    })

    map.addControl(new mapboxgl.NavigationControl(), 'bottom-right')
    BaseLayerSwitch.addEventListener(map, 'clusters')
    if (data) {
      map.on('load', () => {
        BaseLayerSwitch.initSources(map, 'FR')
        map.addSource('buildings', {
          type: 'geojson',
          data: data,
          cluster: true,
          clusterMaxZoom: 14,
          clusterRadius: 50
        })

        map.addLayer({
          id: 'clusters',
          type: 'circle',
          source: 'buildings',
          filter: ['has', 'point_count'],
          paint: {
            'circle-color': [
              'step',
              ['get', 'point_count'],
              '#8F9BCC',
              100,
              '#476291',
              750,
              '#212E44'
            ],
            'circle-radius': [
              'step',
              ['get', 'point_count'],
              20,
              100,
              30,
              750,
              40
            ]
          }
        })

        map.addLayer({
          id: 'cluster-count',
          type: 'symbol',
          source: 'buildings',
          filter: ['has', 'point_count'],
          layout: {
            'text-field': '{point_count_abbreviated}',
            'text-font': ['DIN Offc Pro Medium', 'Arial Unicode MS Bold'],
            'text-size': 12
          },
          paint: {
            'text-color': '#ffffff'
          }
        })

        map.addLayer({
          id: 'unclustered-point',
          type: 'circle',
          source: 'buildings',
          filter: ['!', ['has', 'point_count']],
          paint: {
            'circle-color': '#212E44',
            'circle-radius': 11,
            'circle-stroke-width': 2,
            'circle-stroke-color': '#fff'
          }
        })

        map.addSource('unclustered-locations', {
          type: 'geojson',
          data: data,
          cluster: false,
          clusterMaxZoom: 14,
          clusterRadius: 50
        })

        map.addLayer({
          id: 'hidden-locations',
          type: 'circle',
          source: 'unclustered-locations',
          paint: {
            'circle-radius': 0
          }
        })

        map.on('mouseenter', 'clusters', () => {
          map.getCanvas().style.cursor = 'pointer'
        })
        map.on('mouseleave', 'clusters', () => {
          map.getCanvas().style.cursor = ''
        })

        map.on('click', 'clusters', (e) => {
          const features = map.queryRenderedFeatures(e.point, {
            layers: ['clusters']
          })
          const clusterId = features[0].properties.cluster_id
          map.getSource('buildings').getClusterExpansionZoom(
            clusterId,
            (err, zoom) => {
              if (err) return

              map.easeTo({
                center: features[0].geometry.coordinates,
                zoom: zoom
              })
            }
          )
        })
      })
    }
    return map
  }
}

export default MapWithClusters
